import{_ as e,o as a,c as r,O as i}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 46.2-1503.5 Biennial report.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-1503.5.md","filePath":"vacode/46.2-1503.5.md"}'),t={name:"vacode/46.2-1503.5.md"},n=i('<h1 id="§-46-2-1503-5-biennial-report" tabindex="-1">§ 46.2-1503.5 Biennial report. <a class="header-anchor" href="#§-46-2-1503-5-biennial-report" aria-label="Permalink to &quot;§ 46.2-1503.5 Biennial report.&quot;">​</a></h1><p>The Board shall submit a biennial report to the Governor and General Assembly on or before November 1 of each even-numbered year. The biennial report shall contain, at a minimum, the following information: (i) a summary of the Board&#39;s fiscal affairs, (ii) a description of the Board&#39;s activities, (iii) statistical information regarding the administrative hearings and decisions of the Board, and (iv) a general summary of all complaints received against licensees and the procedures used to resolve the complaints.</p><p>1995, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0767" target="_blank" rel="noreferrer">767</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0816" target="_blank" rel="noreferrer">816</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0650" target="_blank" rel="noreferrer">650</a>.</p>',3),o=[n];function s(l,c,d,_,p,h){return a(),r("div",null,o)}const g=e(t,[["render",s]]);export{m as __pageData,g as default};
